import React, { Component } from "react";

export default class index extends Component {
  render() {
    return (
      <li>
        <label>
          <input type="checkbox" />
          <span>XXXXXXX</span>
        </label>
        <button className="btn btn-danger" style={{ display: "none" }}>
          delete
        </button>
      </li>
    );
  }
}
